import React, { useState, useEffect } from "react";
import Contentstack from 'contentstack';
import "./Posts.css";
<script src="https://cdn.jsdelivr.net/npm/contentstack@latest/dist/web/contentstack.min.js"></script>





function PostsCards() {
  const [posts, setPosts] = useState([]);
  const myHeaders = new Headers();
  myHeaders.append("Content-Type", "application/json");
  myHeaders.append("api_key", "blt19d69e3984ff963a");
  myHeaders.append("delivery_token", "cs42701f5dfb9cd8f0636dff0a");

  const fetchPost = async () => {

    const Stack = Contentstack.Stack({ "api_key": "blt19d69e3984ff963a", "delivery_token": "cs42701f5dfb9cd8f0636dff0a", "environment": "hd-prod" });
    const Q = Stack.ContentType('hd_food_blog').Query()
    // console.log(Q)
    Q
      .where("title")
      .includeSchema()
      .includeCount()
      .toJSON()
      .find()
      .then(function (result) {
        return result
      })
    const response = await fetch(Q);
    const data = await response.json();
    setPosts(data);
  };

  useEffect(() => {
    fetchPost();
  }, []);
  return (
    <div className="App">
      <p> {posts.title} </p>
      <button onClick={fetchPost}> get new joke </button>
    </div>
  );
}
export default PostsCards;

